        function organizeIntoRows(positions) {
            const rows = [[], [], [], []];
            
            positions.forEach((pos, idx) => {
                if (pos === 'GK') rows[0].push(idx);
                else if (['CB', 'LB', 'RB', 'LWB', 'RWB'].includes(pos)) rows[1].push(idx);
                else if (['CM', 'CDM', 'CAM', 'LM', 'RM'].includes(pos)) rows[2].push(idx);
                else rows[3].push(idx);
            });
            
            return rows.filter(row => row.length > 0);
        }
        
