                'LWB': ['LWB', 'LB'], 'RWB': ['RWB', 'RB'],
                'CDM': ['CDM', 'CM'], 'CM': ['CM', 'CDM', 'CAM'], 'CAM': ['CAM', 'CM'],
                'LM': ['LM', 'LW'], 'RM': ['RM', 'RW'],
                'LW': ['LW', 'LM', 'ST'], 'RW': ['RW', 'RM', 'ST'],
